import React, { useEffect, useState } from 'react';
import './Team.css';


const Team = () => {
    const [images, setImages] = useState([]);


    useEffect(() =>{
        const fetchImages = async () => {
            try{
                const response = await fetch('http://127.0.0.1:8000/api/team-card/');
                
                if (!response.ok) {
                    throw new Error(`Ошибра при загрузке изображение: ${response.statusText}`);
                }

                const data = await response.json();
                setImages(data);
            } catch(error) {
                console.error('Ошибка при выполнении запроса:', error.message)
            }
        };

        fetchImages();
    }, []);

    return (
        <div className='main__content'>
            <h1>Страница о команде</h1>
            <p>Добро пожаловать на страницу о команде!</p>
            <div className='image-gallery'>
                {images.map(image => (
                    <div key={image.id} className='image-item'>
                        <img
                            src={image.image}
                            alt={image.caption}
                            onError={(e) => console.error('Ошибка загрузки изображения:', e)}
                            />
                            {image.caption && <p>{image.caption}</p>}
                        </div>
                ))}
            </div>
        </div>
    );
};

export default Team;
